import Head from "next/head";
import AppLayout from "../components/AppLayout";
import Chart from "chart.js";

const Profile = () => {
  return (
    <AppLayout>
      <Head>
        <title>NTB</title>
      </Head>
      <div>하하하</div>
    </AppLayout>
  );
};

export default Profile;
